html{
    body{
        div{
            max-width: 1380px;
            padding: 0px 50px;
            margin:auto;
            .search-bar{
                float: left;
                width: 100%;
                padding-left: 0;
                padding-bottom: 60px;

            }
            h2{
                width: 100%;
                border-bottom: solid 0.75px #cecece;
                margin: 80px 0px 60px 0px;
                padding-bottom: 20px;
            }
            .artist-list{
                display: flex;
                justify-content: space-between;
                flex-wrap: wrap;
                width: 100%;
                .artist-item{
                    width: 33.3%;
                    height: 290px;
                    margin-bottom: 100px;
                    .artist-thumbnail{
                        margin-bottom: 16px;
                    }
                    .artist-name{
                        color: #777777;
                        font-size: 14px;
                        margin-bottom: 6px;
                    }
                }
            }
        }
    }
}
